import React from "react";
import { Link } from "react-router-dom";
import waterLeaf from "./images/waterLeaf.jpeg";
import {WaterLeaf} from "./styles"

export const NavBar = () => {
  return (
    <div>
      <img alt="water leaf" src={waterLeaf}></img>
      <Link to="/">Home</Link>
      <Link to="/about">About</Link>
    </div>
  );
};
